import logo from './logo.svg';
import './App.css';
import Item from './MyItem'
import React from 'react';

class StarWars extends React.Component {
  constructor(){
    super()
    this.state={
      name: null,
      height: null,
      homeworld: null,
      films: [],
    }
  }
  getNewCharacter(){
    console.log("Get New Character")
    this.setState({
      name: Luke,
      height: 172,
      homeworld: 'Tatooine',
      films: ['item1', 'item2'],
    })
  }

  render(){
    return(
      <div>
        <h1>{this.state.name}</h1>
        <p>{this.state.height}</p>
        <p>Homeworld: {this.state.homeworld}</p>
        <ul>
          <li>{this.state.films}</li>
        </ul>
        <button type="button" 
        onClick={()=> this.getNewCharacter()} 
        className="btn"
        >Randomize Character</button>
      </div>
    )
  }
}






function App() {
  return (
    <div className="App">
      <header className="App-header">
        <StarWars/>
      </header>
    </div>
  );
}

export default App;
